        if num == 0:
            return False
        return any(int(d) != 0 for d in str(num).replace('-', '').replace('.', ''))

    return sum(1 for num in arr if has_nonzero_digit_sum(num))

def encode(message):
    result = ""
    for char in message:
        if char.isalpha():
            if char.lower() in 'aeiou':
                result += chr((ord(char.lower()) + 2 - ord('a')) % 26 + ord('A'))
            else:
                result += char.swapcase()
        else:
            result += char
    return result

def is_multiply_prime(a):
    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(n ** 0.5) + 1):
            if n % i == 0:
                return False
        return True

    prime_count = 0
    i = 2
    while i * i <= a and prime_count < 3:
        if a % i == 0 and is_prime(i):
            prime_count += 1
            a //= i
        else:
            i += 1

    if a > 1 and is_prime(a):
        prime_count += 1

    return prime_count >= 3

