def max_fill(grid, capacity):
    total_buckets = 0
    for row in grid:
        water_level = 0
        for well in row:
            if well:
                water_level += 1
                if water_level == capacity:
                    total_buckets += 1
                    water_level = 0
        if water_level > 0:
            total_buckets += 1
    return total_buckets

def bf(planet1, planet2):
    planets = ["Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"]

    if planet1 not in planets or planet2 not in planets:
        return ()

    start_idx = planets.index(planet1)
    end_idx = planets.index(planet2)

    if start_idx < end_idx:
        return tuple([planet for planet in planets if start_idx < planets.index(planet) < end_idx])
    else:
        return tuple([planet for planet in planets if end_idx < planets.index(planet) < start_idx])

