def fix_spaces(text):
    result = []
    consecutive_spaces = 0

    for c in text:
        if c == ' ':
            consecutive_spaces += 1
            if consecutive_spaces > 2:
                result.append('-')
                consecutive_spaces = 0
            else:
                result.append('_')
        else:
            result.append(c)
            consecutive_spaces = 0

