def intersection(interval1, interval2):
    def length_of_intersection(interval1, interval2):
        start1, end1 = interval1
        start2, end2 = interval2

        if start1 > end2 or start2 > end1:
            return 0

        intersection_start = max(start1, start2)
        intersection_end = min(end1, end2)

        return intersection_end - intersection_start + 1

    length = length_of_intersection(interval1, interval2)

    if is_prime(abs(length)):
        return "YES"
    else:
        return "NO"

def minPath(grid, k):
    def dfs(x, y, path_len, path, visited):
        nonlocal min_path
        if path_len == k:
            if not min_path or path < min_path:
                min_path = path[:]

        if path_len >= k:
            return

        for dx, dy in [(1, 0), (-1, 0), (0, 1), (0, -1)]:
            nx, ny = x + dx, y + dy
            if 0 <= nx < len(grid) and 0 <= ny < len(grid[0]) and not visited[nx][ny]:
                visited[nx][ny] = True
                dfs(nx, ny, path_len + 1, path + [grid[nx][ny]], visited)
                visited[nx][ny] = False

    visited = [[False for _ in range(len(grid[0]))] for _ in range(len(grid))]
    min_path = None
    for i in range(len(grid)):
        for j in range(len(grid[0])):
            visited[i][j] = True
            dfs(i, j, 1, [grid[i][j]], visited)
            visited[i][j] = False

    return min_path

